script: |
  super -f tsv -I q1234.sql | sort > q1234.out

vector: true

inputs:
  - name: q1234.sql
    data: |
      SELECT + + COUNT ( * ) * + COUNT ( CAST ( 65 AS REAL ) ) AS col1 FROM tab1 AS cor0 CROSS JOIN tab2 AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q1234.out
    data: |
      81
